"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Это попытка изобрести велосипед. Я попытался сделать удобный инженерный калькулятор, на котором удобно считать тригонометрические функции, логарифмы, извлечения корня, возведения в степень, расчёт площади различных фигур и другие вычисления использующие различные константы. Так-же можно производить другие вычисления используя выражения со скобками. </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Все полученные результаты отображаются в правой половине верхнего окна. Результат можно быстро вернуть в строку ввода, нужно просто кликнуть по нужному.</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Обратное число вычисляется вводом исходного числа и нажатием кнопки 1/х.</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Проценты вычисляются вводом исходного числа, вводом знака + или - , вводом процентов и нажатием кнопки %.</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Что такое логарифм?</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; background-color:#e9f8ed;\">Логарифм по основанию a от аргумента x , это степень,,в которую надо возвести число a, чтобы плучить число x.</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\">Обозначение: log</span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff; vertical-align:sub;\">a</span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff;\">x</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\"> = </span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff;\">b</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\">, где </span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff;\">a</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\"> — основание, </span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff;\">x</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\"> — аргумент, </span><span style=\" font-family:\'Times New Roman,Times,serif\'; font-size:14pt; font-style:italic; color:#101010; background-color:#ffffff;\">b</span><span style=\" font-family:\'Arial,Helvetica,sans-serif\'; font-size:14pt; color:#101010; background-color:#ffffff;\"> — собственно, чему равен логарифм.</span></p>\n"
